exports.board = function () {
  return board;
};

exports.action = function(x, y, user) {

	// Chop tree
	if(board[y][x] === 5) {
		board[y][x] = 11;
		return { a: true, type: "wood" };
	}

	// Build bridge
	if(board[y][x] === 2) {
		if(user.CanBuildBridge()) {	
			board[y][x] = 6;
			return { a: true, type: "bridge" };
		}

		
	}

	return { a: false };
};

exports.noneUserAction = function(x, y) {
	if(board[y][x] === 11) {
		board[y][x] = 5;
		return true;
	}
};